import React, { Component} from 'react'
import HouseService from '../services/HouseService'

class DeleteProperty extends Component {
  state = {
    checked : false
  }



  deleteHouse = () => {
    HouseService.deleteHouse(this.props.match.params.id, this.props.match.params)
  }



  handleFormSubmit = () => {
    this.preventDefault()

  }

  handleCheckbox = () => {
    this.setState({ checked: !this.state.checked})
  }




  render(){
    return(
      <form onSubmit={this.handleFormSubmit}>
        <h1>{this.props.match.params.house}</h1>
        <p>You're about to delete this property. Are you sure?</p>
        <input type='checkbox' defaultChecked={this.state.checked} onChange={this.handleCheckbox} />
        <button type='submit'>Delete</button>
      </form>
    )
  }
}

export default DeleteProperty
